import React, { Component } from 'react'
import './footer.css'

class Footer extends Component{
    render() {
        return(
            <div className="footer">
                    <div className="fb">
                    <i  style={{color: "black"}}class="fa fa-facebook" aria-hidden="true">facebook</i>
                    </div>
            </div>
        );
    }
}

export default Footer
